/**
 * @func weixin - 在微信内点击下载的处理方法
 * @param {Array} dom - 目标节点的数组,若无统一类名则手动做成数组传入
  */

// 微信端判断
$(function() {
  var u = navigator.userAgent;
  if(u.toLowerCase().match(/MicroMessenger/i)=="micromessenger") {
    weixin($('.xzan'));
  }
})

function weixin(dom) {
  var u = navigator.userAgent;
  var isAndroid = u.indexOf('Android') > -1 || u.indexOf('Linux') > -1; //android
  var isIOS = !!u.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/); //ios
  if(u.toLowerCase().match(/MicroMessenger/i)=="micromessenger") {  
    // 如果是微信
    var $body = document.getElementsByTagName('body')[0];
    var body;
    var $modal = document.createElement('div');
    $modal.setAttribute('class', 'micromessenger-modal');
    $modal.setAttribute('style', 'display: none;position: fixed;top: 0;left: 0;width: 100%;height: 100%;background-color: rgba(0, 0, 0, .8);z-index: 9999999;')
    if(isAndroid) {
      body = '<div class="bg android" style="width:100%;height:100%;background-size: 100%;background-repeat: no-repeat;background-image: url(data:image/png;base64,);"></div>'
    }
    if(isIOS) {
      body = '<div class="bg ios" style="width:100%;height:100%;background-size: 100%;background-repeat: no-repeat;  background-image: url(data:image/png;base64,);"></div>'
    }  

    $modal.innerHTML = body;
    $body.append($modal);  
    if(dom.length > 1) {
      for(var i = 0; i < dom.length; i++) {
        dom[i].addEventListener('click', function(e) {
          e.preventDefault();
          $modal.style.display = 'block';   
        })
      }
    } else {
      dom[0].addEventListener('click', function(e) {
        e.preventDefault();
        $modal.style.display = 'block';
      })
    }
    $modal.addEventListener('click', function() {
      $modal.style.display = 'none';
    })
  }        
}    